import React from "react";
import GitHubCalendar from "react-github-calendar";
import { Row } from "react-bootstrap";

function Github() {
  const colourTheme = {
    background: "transparent",
    text: "#ffffff",
    // grade4: "#8400b8",
    // grade3: "#b22ff4",
    // grade2: "#b265f6",
    // grade1: "#c084f5",
    // grade0: "#ecd9fc",
    grade4: "rgb(33,139,130)",

  };
  return (
    <Row style={{ justifyContent: "center", paddingBottom: "10px" }}>
      <h1 className="project-heading" style={{ paddingBottom: "20px" }}>
        My <strong className="purple">GitHub</strong> Looks Like...
      </h1>
      <GitHubCalendar
        username="liza23"
        blockSize={15}
        blockMargin={5}
        theme={colourTheme}
        fontSize={16}
      />
    </Row>
  );
}

export default Github;
